import React from 'react';

export default function VideoList({ videos, onVideoSelect }) {
    const a = () => {
        console.log(videos);
    };

    return (
        <div>
            <button onClick={a}>Button</button>
            <ul>
                {videos.map((v, i) => {
                    return <li key={i}>{v}</li>;
                })}
            </ul>
        </div>
    );
}
